//Runtime: 1052 ms, faster than 75.12% of C++ online submissions for Bitwise ORs of Subarrays.
//Memory Usage : 91.1 MB, less than 100.00% of C++ online submissions for Bitwise ORs of Subarrays.
class Solution {
public:
	int subarrayBitwiseORs(vector<int>& A) {
		const auto n = A.size();
		if (!n)
			return 0;
		unordered_set<int> result;
		for (size_t i = 0; i < A.size(); ++i) {
			int j = i - 1;
			int x = 0, y = A[i];
			result.insert(y);
			while (j >= 0 && x != y) {
				x |= A[j];
				y |= A[j];
				result.insert(y);
				--j;
			}
		}
		return result.size();
	}
};

